import axios from "axios";
import {useState} from "react";
import {useEffect} from "react";

export function Rooms({username}) {
    const [selectedRoom, setSelectedRoom] = useState("Main room");
    const [rooms, setRooms] = useState([]);

    async function loadRooms() {
        const result = await axios.post("/getrooms", {username: username});
        setRooms(result.data);
    }

    useEffect(function() {
        loadRooms();
    }, []);
    console.log("penis");
    function handleRoomChange(name) {
        setSelectedRoom(name);
    }

    return (
        <div className="chatRooms">
            {rooms.map(function(room, index) {
                return (
                    <button 
                    className={selectedRoom === room.name ? "selected chatRoom" : "chatRoom"} 
                    key={room.name} 
                    onClick={handleRoomChange(room.name)}>
                        {room.name}
                    </button>
                )

            })}
        </div>
    )

}
